import React, { Component } from "react";
import { Row, Col, Container, Button } from "react-bootstrap";

class RobotState extends Component {
  state = {};
  render() {
    return (
      <div>
        <Row>
          <Col>
            <h2>Teleoperation</h2>
            <p className="mt-0">x: , y: , z:</p>
            <p className="mt-0">Velocity:</p>
            <p className="mt-0">GPS:</p>
            <p className="mt-0">Battery:</p>
          </Col>
        </Row>
      </div>
    );
  }
}

export default RobotState;
